import React from 'react';
import {Grid, Typography, makeStyles, Paper, Avatar, Table, TableBody, TableCell, TableRow} from '@material-ui/core';

const useStyles = makeStyles((theme: any)=>({
    root : {
        width : '100%',
        height : '91vh'
    },
    displayFlex : {
        padding :theme.spacing(10),
        display : 'flex',
        justifyContent : 'center',
        alignItems : 'center',
        height : '100%'
    },
    spaceEvenly : {
        display : 'flex',
        flexDirection : 'column',
        justifyContent : 'space-evenly',
        alignItems : 'center',
        height : '100%',
        width : '80%',
        margin:'auto'
        // paddingLeft : theme.spacing(10),
        // paddingRight : theme.spacing(10)
    },
    paperStyle : {
        width : '100%',
        height : '100%'
    },
    avatharStyle : {
        width : theme.spacing(20),
        height : theme.spacing(20)
    }
}))

function AdminProfileDetails() {
    const classes = useStyles()
    return (
        <div className={classes.root}>
            <div className={classes.displayFlex}>
                <Paper className = {classes.paperStyle}>
                    <div className={classes.spaceEvenly}>
                        <Avatar variant='square' className={classes.avatharStyle} />
                        <Table style={{padding:'20px'}}>
                            <TableBody>
                            <TableRow >
                                <TableCell>Name</TableCell>
                                <TableCell>SomeName</TableCell>
                            </TableRow>
                            <TableRow >
                                <TableCell>Email</TableCell>
                                <TableCell>SomeName@123.com</TableCell>
                            </TableRow>
                            <TableRow >
                                <TableCell>Admin Type</TableCell>
                                <TableCell>Nutritionist</TableCell>
                            </TableRow>
                            <TableRow >
                                <TableCell>Password</TableCell>
                                <TableCell>**********</TableCell>
                            </TableRow>
                            </TableBody>
                        </Table>
                    </div>
                </Paper>
            </div>
        </div>
    )
}

export default AdminProfileDetails
